import React from 'react'
import { useSelector } from 'react-redux'
import { currentType } from '../../types/Types'
import { useProfile } from './profile.hook'
import "./Profile.css"

const Profile = () => {
    const exit = useProfile()

    const {current}: currentType = useSelector((state : {current: currentType}): currentType => state.current)
    return (
    <div style={{display: "flex", flexDirection: "row", gap: "30px"}}>
        <h4>{current.name}</h4>
        <h4>{current.email}</h4>
        <button style={{height: "30px", width: "60px", marginTop: "15px"}} onClick={exit}>Exit</button>
    </div>
  )
}

export default Profile
